import "./App.css";
import kpi_styles from "./styles/KPI.module.css";
import mstyles from "./styles/Main.module.css";

import Sidebar from "./components/Sidebar";
import KPI from "./components/KPI";
import LineChart from "./components/LineChart";
import Transactions from "./components/Transactions";
import Navbar from "./components/Navbar";

function App() {
  return (
    <>
      <Navbar></Navbar>
      <Sidebar></Sidebar>
      <main className="main">
        <div className={` grid`}>
          <div className={kpi_styles["kpi-grid"]}>
            <KPI
              className={kpi_styles.net_worth}
              name={"Net Worth"}
              value={1234}
            ></KPI>
            <KPI
              className={kpi_styles.inflow}
              name={"Inflow"}
              value={1000}
            ></KPI>
            <KPI
              className={kpi_styles.expenses}
              name={"Expenses"}
              value={500}
            ></KPI>
          </div>

          <LineChart></LineChart>
          <Transactions></Transactions>
        </div>
      </main>
    </>
  );
}

export default App;

